// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract Donation {
    address public Owner;
    // mapping做每個觀眾的address對應到觀眾的捐款金額
    mapping (address => uint256) DonationList;
    // 每次有新的捐款，都會觸發這個事件
    event Donate(address indexed sender, uint256 value);
    event WithDraw(address indexed owner, uint256 value);
    modifier OnlyOwner() {
        require(msg.sender == Owner, "Only owner can call this function.");
        // 要記得_，叫回原本函式的本體
        _;
    }
    constructor () {
        Owner = msg.sender;
    }
    // 每一次收到donate時都會更新DonateList，所以額外寫一個Donate_Receive function
    // receive函是只能在沒有calldata時被使用
    // 想要收錢就要加上payable
    // 會讓觀眾呼叫，所以加上public
    function donate() public payable {
        // 因為會改動state儲存空間上面的變數，因此不能用receive做
        DonationList[msg.sender] += msg.value;
        emit Donate(msg.sender, msg.value);
    }
    // 查詢總捐款金額的函式
    // 該函式只會讀取狀態，所以可以加上view
    function GetDonateHistory() public view returns(uint256){
        // 誰想查詢就回傳他的金額
        return DonationList[msg.sender];
    }
    // 查詢VIP等級
    // 回傳string時要用memory
    function GetVipLevel() public view returns(string memory) {
        uint256 Donate_value = DonationList[msg.sender];
        if(Donate_value > 10 ether) {
            return "UR";
        }
        else if(Donate_value > 5 ether) {
            return "SR";
        }
        else if(Donate_value > 1 ether) {
            return "R";
        }
        else if(Donate_value > 0) {
            return "N";
        }
        else{
            return "None";
        }
    
    }
    function Withdraw_Donation() OnlyOwner public {
        address payable Receiver = payable(Owner);
        uint256 value = address(this).balance;
        Receiver.transfer(value);
        emit WithDraw(Receiver, value);
    }
}

